import React from 'react';

const columns = [
  {
    title: 'Name',
    dataIndex: 'name', 
    render: (text) => <a>{text}</a>,
  },
  {
    title: 'Age',
    dataIndex: 'age',
  },
  {
    title: 'Address',
    dataIndex: 'address',
  },
  {
    title: 'Booking',
    dataIndex: 'book',
  },
];

export default columns;
